import React from "react";
import "app-header.module.css";

const AppHeader = () =>{
    return(
        <div>
            <div>
                <h1>My Todo List</h1>
            </div>

            <div>
                1 more, to do
            </div>

        </div>


    )
}

export default AppHeader;
